              href="#"
              class="delete"
              data-toggle="modal"
              onClick={() => props.delete(id)}
            >
              <i class="material-icons" data-toggle="tooltip" title="Delete">
                &#xE872;
              </i>
            </a>
          </Td>
                <Td>{username}</Td>
                <Td>{email}</Td>
                <Td>{profilepic}</Td>
            </Tr>
    )
}

export default Userscard
